drop database if exists changgou_goods;
create database changgou_goods;
use changgou_goods;

-- 品牌表
drop table if exists tb_brand;
create table tb_brand
(
    id int auto_increment primary key comment '品牌编号',
    name varchar(50) not null comment '品牌名',
    image varchar(500) comment '图片',
    letter char comment '字母',
    seq int comment '排序'
);




-- 相册表
drop table if exists tb_album;
create table tb_album
(
    id int auto_increment primary key comment '相册编号',
    title varchar(50) not null comment '相册名',
    image varchar(500) comment '相册封面',
    image_items varchar(1000) comment '相册图片列表'
);



-- 下面三个表关系为：一个模板对应多个规格，一个模板对应多个参数。
-- 这里没有建立外键关系，提高查询的效率
-- 模板表
drop table if exists tb_template;
create table tb_template
(
    id int auto_increment primary key comment '模板编号',
    name varchar(50) not null comment '模板名',
    spec_num int not null comment '规格数量',
    para_num int not null comment '参数数量'
);



-- 规格表
drop table if exists tb_spec;
create table tb_spec
(
    id int auto_increment primary key comment '规格Id',
    name varchar(50) not null comment '规格名',
    options varchar(50) not null comment '规格选项',
    seq int not null comment '排序',
    template_id int not null comment '模板ID'
);




-- 参数表
drop table if exists tb_para;
create table tb_para
(
    id int auto_increment primary key comment '参数Id',
    name varchar(50) not null comment '参数名',
    options varchar(50) not null comment '选项',
    seq int not null comment '排序',
    template_id int not null comment '模板ID'
);




-- 分类表
drop table if exists tb_category;
create table tb_category
(
    id int auto_increment primary key comment '分类编号',
    name varchar(50) comment '类名',
    goods_num int comment '商品数量',
    is_show char comment '是否显示',
    is_menu char comment '是否导航',
    seq int comment '排序',
    parent_id int comment '父类ID',
    template_id int not null comment '模板ID'-- 这里可以根据用户所选择的三级分类，查找出对应的模板ID，进而可以推荐商品的属性：规格和参数。
);



-- 分类品牌表
drop table if exists tb_category_brand;
create table tb_category_brand
(
    category_id int comment '分类编号',
    brand_id int comment '品牌编号',
    primary key(category_id, brand_id)
);


-- 根据分类编号查找所有品牌
select brand.* from tb_brand brand where id in (select tcb.brand_id from tb_category_brand tcb where category_id = 1);
-- 根据分类编号查找所有 
select template_id from tb_category where id = 1;
select * from tb_spec where template_id = 1;
select spec.* from tb_spec spec where template_id in (select tc.template_id from tb_category tc where id = 1);

-- 商品信息表
drop table if exists tb_sku;
create table tb_sku
(
    id bigint(50) comment '商品ID' primary key,
    sn varchar(50) not null comment '商品条码',
    name varchar(50) not null comment 'SKU名称',
    price int not null comment '价格（分）',
    num int not null comment '库存数量',
    alert_num int not null comment '库存预警数量',
    image varchar(500) default null comment '商品图片',
    images varchar(500) default null comment '商品图片列表',
    weight int default null comment '重量（克）',
    create_time datetime default null comment '创建时间',
    update_time datetime default null comment '更新时间',
    spu_id bigint(50) default null comment 'SPUID',
    category_id int default null comment '类目ID',
    category_name varchar(50) default null comment '类目名称',
    brand_name varchar(50) default null comment '品牌名称',
    spec varchar(500) default null comment '规格',
    sale_num int default 0 comment '销量',
    comment_num int default 0 comment '评论数',
    status char(1) not null default '1' comment '商品状态 1-正常，2-下架，3-删除'
);



-- 商品信息子表
drop table if exists tb_spu;
create table tb_spu
(
    id bigint(50) primary key comment '编号',
    sn varchar(50) comment '货号',
    name varchar(50) comment 'SPU名',
    caption varchar(200) comment '副标题',
    brand_id int comment '品牌ID',
    category1_id int comment '一级分类',
    category2_id int comment '二级分类',
    category3_id int comment '三级分类',
    template_id int comment '模板ID',
    freight_id int comment '运费模板id',
    image varchar(500) comment '图片',
    images varchar(500) comment '图片列表',
    sale_service varchar(500) comment '售后服务',
    introduction text comment '介绍',
    spec_items varchar(500) comment '规格列表',
    para_items varchar(500) comment '参数列表',
    sale_num int default 0 comment '销量',
    comment_num int default 0 comment '评论数',
    is_marketable char(1) default '0' comment '是否上架,0已下架，1已上架',
    is_enable_spec char(1) default '1' comment '是否启用规格',
    is_delete char(1) default '0' comment '是否删除',
    status char(1) default '0' comment '审核状态，0未审核，1已审核'
);




-- 订单表
drop table if exists tb_pref;
create table tb_pref
(
    id int primary key comment '编号',
    cate_id varchar(50) comment '分类ID',
    buy_money varchar(50) comment '消费金额',
    pre_money int comment '优惠金额',
    start_time datetime comment '活动开始日期',
    end_time datetime comment '活动截至日期',
    type char comment '类型,1:普通订单，2：限时活动',
    status char not null comment '状态,1:有效，0：无效'
);


-- 日志记录表
drop table if exists tb_stock_back;
create table tb_stock_back
(
    order_id int primary key comment '订单id',
    sku_id varchar(50) comment 'SKU的id',
    num int comment '回滚数量',
    status char comment '回滚状态',
    create_time datetime comment '创建时间',
    back_time datetime comment '回滚时间'
);


